description:
Tabrez Khan is an orphan who lives with the Diwakar family, which consists of Police Inspector Raj; his journalist wife, Shobha; their son, Chintoo, and Raj's brother, Devdutt. Raj is killed and the Police are unable to apprehend his killers. Thereafter Devdutt joins the Police Force, does his work honestly and diligently and angers Bhawani Chaudhari, his senior officers, as well as differences arise between him and Tabrez, with the later leaving home to join the Police Academy. Months later Tabrez returns home as a Sub-Inspector - but nothing is the same anymore - Shobha is missing, Chintoo is dead, and Devdutt has been suspended, has taken to crime, and is wanted by the Police. 


